import React, { useEffect, useState, useRef } from "react";
import "../css/landing.css";
import { motion } from "framer-motion";
import { Link, useNavigate, useLocation } from "react-router-dom";
import "../css/login.css";

function Form(props) {
  const [clientName, setClientName] = useState("");
  const [dateOfBirth, setDateOfBirth] = useState("");
  const [submitMsg, setSubmitMsg] = useState("");
  const [clinic, setClinic] = useState("");
  const [dateNeededBy, setDateNeededBy] = useState("");
  const [doctor, setDoctor] = useState("");

  const navigate = useNavigate();
  const location = useLocation();

  const { formChoice } = props;

  function handleLocationChoice(e) {
    setClinic(e.target.value);
  }
  function handleDoctorChoice(e) {
    setDoctor(e.target.value);
  }

  function updateForm(e) {
    if (e.target.id === "clientName") {
      setClientName(e.target.value);
    }
    if (e.target.id === "dateOfBirth") {
      setDateOfBirth(e.target.value);
    }
    if (e.target.id === "dateNeededBy") {
      setDateNeededBy(e.target.value);
    }
  }

  if (props.formChoice === "formulaAndFood") {
    const handleSubmit = async (e) => {
      e.preventDefault();

      if (clientName == "" || dateOfBirth == "") {
        setSubmitMsg("unfilled");
        return;
      } else setSubmitMsg("");

      async function sendForm() {
        const response = await fetch(
          "http://127.0.0.1:4000/pdf/formula-and-food",
          {
            method: "POST",
            headers: {
              "Content-Type": "application/json",
            },
            body: JSON.stringify({
              formChoice,
              clientName,
              dateOfBirth,
              clinic,
              doctor,
              dateNeededBy,
            }),
          }
        );
        const user = await response.json();
      }
      sendForm().then(() => {
        navigate(
          "../submitted",
          { state: { formChoice, clientName, dateOfBirth } },
          { replace: true }
        );
      });
    };

    return (
      <div className="formField">
        <form action="POST" onSubmit={handleSubmit}>
          <select
            defaultValue="default"
            onChange={(e) => handleLocationChoice(e)}
            className="defaultSelect noTopMargin"
          >
            <option value="default">Choose your usual office location</option>
            <option value="familyCareNorth">FAMILY CARE NORTH</option>
            <option value="childrensCareNorth">CHILDREN’S CARE NORTH</option>
            <option value="totalWomensCare">TOTAL WOMEN’S CARE</option>
            <option value="nicholsPediatricAtGreaterNaplesYMCA">
              NICHOLS PEDIATRIC AT GREATER NAPLES YMCA
            </option>
            <option value="childrensCareEast">CHILDREN’S CARE EAST</option>
            <option value="dentalCareEast">DENTAL CARE EAST</option>

            <option value="friendshipHealth">FRIENDSHIP HEALTH</option>
            <option value="marionEFether">MARION E. FETHER</option>
            <option value="floridaStateUniversityCollegeOfMedicine">
              FLORIDA STATE UNIVERSITY, COLLEGE OF MEDICINE
            </option>
            <option value="familyCareAtItech">FAMILY CARE AT ITECH</option>
            <option value="nicholsCommunityHealthCenter">
              NICHOLS COMMUNITY HEALTH CENTER
            </option>
          </select>
          <select
            defaultValue="default"
            onChange={(e) => handleDoctorChoice(e)}
            className="defaultSelect noTopMargin"
          >
            <option value="default">Choose your usual doctor</option>
            <option value="familyCareNorth">Dr. Adele De Vera</option>
            <option value="childrensCareNorth">Dr. Alexander Ziegler</option>
            <option value="familyCareNorth">Dr. Alexandra Sarac</option>
            <option value="childrensCareNorth">
              Dr. Alicia Fernandez-Garcia
            </option>
            <option value="childrensCareNorth">Dr. Amy Iannone</option>
            <option value="familyCareNorth">Dr. Bernadette Delumpa</option>
            <option value="familyCareNorth">Dr. Courtney Whitt</option>
            <option value="childrensCareNorth">Dr. Diana Chavez</option>
            <option value="familyCareNorth">Dr. Douglas Keck</option>
            <option value="childrensCareNorth">Dr. Douglas Halbert</option>
            <option value="familyCareNorth">Dr. Elizabeth Orr</option>
            <option value="childrensCareNorth">PA Emily Belanus</option>
            <option value="familyCareNorth">Dr. Filadelfo Larios</option>
            <option value="childrensCareNorth">Dr. George Quesnel</option>
            <option value="familyCareNorth">Dr. Gisel Mendez-Cordedro</option>
            <option value="childrensCareNorth">Dr. Guiliana McQuirt</option>
            <option value="familyCareNorth">Dr. Hemal Desai</option>
            <option value="childrensCareNorth">Dr. Javier Rosado</option>
            <option value="familyCareNorth">Dr. Jean Mesador</option>
            <option value="childrensCareNorth">Dr. Jennifer Sherwin</option>
            <option value="familyCareNorth">Dr. Johanne Pierre-Fils</option>
            <option value="childrensCareNorth">Dr. John Carini</option>
            <option value="familyCareNorth">Dr. Jose Puell</option>
            <option value="childrensCareNorth">Dr. Jose Quero</option>
            <option value="familyCareNorth">Dr. Kathleen Ellsworth</option>
            <option value="childrensCareNorth">Dr. Alexander Ziegler</option>
            <option value="familyCareNorth">Dr. Keenan Tamm</option>
            <option value="childrensCareNorth">
              Dr. Lady Joedeline Patalinghug
            </option>
          </select>
          <input
            type="text"
            id="dateNeededBy"
            value={dateNeededBy}
            onChange={(e) => updateForm(e)}
            placeholder="Date Form Needed By"
            className="defaultBtn"
          />
          <input
            type="text"
            id="clientName"
            value={clientName}
            onChange={(e) => updateForm(e)}
            placeholder="Client's name"
            className="defaultBtn"
          />
          <input
            type="text"
            id="dateOfBirth"
            value={dateOfBirth}
            onChange={(e) => updateForm(e)}
            placeholder="Date of Birth"
            className="defaultBtn"
          />
          <input type="submit" className="defaultSubmitBtn" value="Submit" />
        </form>
        {submitMsg == "unfilled" && (
          <p className="failedSubmit">
            Not every form input was filled. Try again please.
          </p>
        )}
        <div className="loginToSignup">
          <p className="dontLogin">By clicking "Submit", you agree to our</p>
          <Link to="../terms-of-use" className="loginLinkToSignup">
            terms
          </Link>
        </div>
        <p className="confirmAge">and confirm you're 18 years or older.</p>
      </div>
    );
  } else {
    return <div></div>;
  }
}

export default Form;
